import styles from './LoginButton.module.scss'

function LoginButton( {onclick, children}) {
    const _props = {
        onclick,
        children,
    };

    return ( 
        <div className={styles['wrapper']}>
            <button className={styles['login-button']} {..._props}>{_props.children}</button>
        </div>
     );
}

export default LoginButton;
